import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Register() {
  const navigate = useNavigate();
  
  const [registerData, setRegisterData] = useState({
    name: '',
    email: '',
    password: '',
    repeatPassword: ''
  });

  const handleRegister = async (e) => {
    e.preventDefault();

    if (registerData.password !== registerData.repeatPassword) {
      alert("Passwords don't match!");
      return;
    }

    try {
      await axios.post('http://localhost:8000/api/user/createAccount', registerData);
      navigate("/login"); // Navigate to login after successful registration
    } catch (error) {
      console.error('Registration failed:', error);
      alert('Registration failed, please try again.');
    }
  };

  return (
    <section className="h-100 gradient-form" style={{ backgroundColor: "#eee" }}>
      <div className="container py-5 h-100">
        <div className="row d-flex justify-content-center align-items-center h-100">
          <div className="col-xl-10">
            <div className="card rounded-3 text-black">
              <div className="row g-0">
                {/* Left Section */}
                <div className="col-lg-6">
                  <div className="card-body p-md-5 mx-md-4">
                    <form onSubmit={handleRegister}>
                      <p>Create your account</p>

                      <div className="form-outline mb-4">
                        <label className="form-label" htmlFor="name">Name</label>
                        <input
                          type="text"
                          id="name"
                          className="form-control"
                          value={registerData.name}
                          onChange={(e) =>
                            setRegisterData({ ...registerData, name: e.target.value })
                          }
                          placeholder="Enter your name"
                        />
                      </div>

                      <div className="form-outline mb-4">
                        <label className="form-label" htmlFor="email">Email</label>
                        <input
                          type="email"
                          id="email"
                          className="form-control"
                          value={registerData.email}
                          onChange={(e) =>
                            setRegisterData({ ...registerData, email: e.target.value })
                          }
                          placeholder="Enter your email"
                        />
                      </div>

                      <div className="form-outline mb-4">
                        <label className="form-label" htmlFor="password">Password</label>
                        <input
                          type="password"
                          id="password"
                          className="form-control"
                          value={registerData.password}
                          onChange={(e) =>
                            setRegisterData({ ...registerData, password: e.target.value })
                          }
                          placeholder="Enter your password"
                        />
                      </div>

                      <div className="form-outline mb-4">
                        <label className="form-label" htmlFor="repeatPassword">Repeat Password</label>
                        <input
                          type="password"
                          id="repeatPassword"
                          className="form-control"
                          value={registerData.repeatPassword}
                          onChange={(e) =>
                            setRegisterData({ ...registerData, repeatPassword: e.target.value })
                          }
                          placeholder="Repeat your password"
                        />
                      </div>

                      <div className="text-center pt-1 mb-5 pb-1">
                        <button
                          className="btn btn-primary btn-block fa-lg gradient-custom-2 mb-3"
                          type="submit"
                        >
                          Register
                        </button>
                      </div>

                      <div className="d-flex align-items-center justify-content-center pb-4">
                        <p className="mb-0 me-2">Already have an account?</p>
                        <button
                          type="button"
                          className="btn btn-outline-danger"
                          onClick={() => navigate("/login")}
                        >
                          Login
                        </button>
                      </div>
                    </form>
                  </div>
                </div>

                {/* Right Section (can be a background or image if you want) */}
                <div className="col-lg-6 d-flex align-items-center gradient-custom-2">
                  <div className="text-white px-3 py-4 p-md-5 mx-md-4"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

